    const [users , setUsers] = useState([]);

    useEffect(() => {
        const URL = "https://dummyapi.io/data/v1/user?limit=10";
    (async()=> {
        const {data} = (await axios.get(URL, {
            headers:{"app_id":"6450dca9caedebc0caec21a1"}})).data;
            setUsers(data);
    })()

},[])

return (
    <>
    {users.map(users => {
        return <div>{users.title}</div>
    })}
    </>
)
}

export default Users
